<p><ruby>橡<rt>xiàng</rt></ruby><ruby>皮<rt>pí</rt></ruby><ruby>牛<rt>niú</rt></ruby><ruby>说<rt>shuō</rt></ruby>:“<ruby>你<rt>nǐ</rt></ruby><ruby>知<rt>zhī</rt></ruby><ruby>错<rt>cuò</rt></ruby><ruby>就<rt>jiù</rt></ruby><ruby>改<rt>gǎi</rt></ruby>，<ruby>还<rt>hái</rt></ruby><ruby>是<rt>shì</rt></ruby><ruby>好<rt>hǎo</rt></ruby><ruby>孩<rt>hái</rt></ruby><ruby>子<rt>zi</rt></ruby>，<ruby>大<rt>dà</rt></ruby><ruby>家<rt>jiā</rt></ruby><ruby>都<rt>dōu</rt></ruby><ruby>会<rt>huì</rt></ruby><ruby>原<rt>yuán</rt></ruby><ruby>谅<rt>liàng</rt></ruby><ruby>你<rt>nǐ</rt></ruby><ruby>的<rt>de</rt></ruby>!<ruby>你<rt>nǐ</rt></ruby><ruby>看<rt>kàn</rt></ruby>，<ruby>谁<rt>shuí</rt></ruby><ruby>来<rt>lái</rt></ruby><ruby>了<rt>le</rt></ruby>?”</p>
